import React from 'react';
import Map from './Map';


const App: React.FC = () => {
  const genHeader = () => (
    <div className=''>
      <h1 style={{fontFamily: "era", textAlign: "center"}}>TAYLOR SWIFT: THE ERAS TOUR</h1>
      <h1 style={{fontFamily: "era", textAlign: "center"}}>Surprise Song Tracker</h1>
    </ div>
  );

  return (
    <div className="flex flex-col m-10" style={{backgroundColor:"whitesmoke"}}>
      <h1 className="text-3xl font-bold m-4 p-10" style={{backgroundColor:'midnightblue', padding:10, color:"white"}}>Eras Tour Tracker</h1>
      <h2 className="text-2xl font-bold m-4 bg-grey-100">Next tour location:</h2>
      <div className="m-10 p-5 bg-white shadow-md">
        <img src="/images/eras-tour.png" alt="Eras Tour" />
      </div>
      <Map/>
    </div>
  );
};

export default App;
